def AuthenticateApplication = context.expand( '${Authenticate Application#Response#$.ResponseStatus}' )
def getAllPrograms = context.expand( '${getAllPrograms#Response#$.ResponseStatus}' )



if ((AuthenticateUser=="OK") && (AuthenticateApplication=="OK") && (getAllPrograms=="OK"))
{
